const dropdown = (props: any) => {
    
    let options = props.list.map((x: any, i: number) => <option value={i}>{x}</option>);
    
    return (
        <select className="custom-select">
            <option selected>{props.defaultText}</option>
            {options}
        </select>
    );
}

export default dropdown;
